import React from 'react';

function AskQuestionHeader(){
    return(
        <div>
            <div style={{height:'65px',marginLeft:'1em'}}>
                <h1>Ask Your Questions</h1>
            </div>
            <div style={{backgroundColor: 'black',height:'1px'}}></div>
        </div>
    )
}

export default AskQuestionHeader;
